import React from 'react'

import './character.scss'

//? 人物：npc人物套装
//? 
export default function Character() {

  const demoData = [
    {
      suitName: "赵云套",
      suitBuffName: "一身是胆",
      type: "中甲",
      against: "水",
      eName: [
        { eName: "涯角枪" },
        { eName: "豪胆兜鍪" },
        { eName: "豪胆中铠" },
        { eName: "豪胆臂甲" },
        { eName: "豪胆胫甲" },
      ],
      buff: [
        { buffName: "化解的消耗气势", number: -1.8 },
        { buffName: "打倒敌人获得的士气点数", number: 5.0 },
        { buffName: "化解成功时威力上升" },
        { buffName: "枪伤害", number: 8.3 },
      ],
    },
  ];
  return (
    <div className="character">
      <h2>25套人物套装总览</h2>
      {/* <table>
        <caption>25套人物套装总览</caption>
        <th>人物</th>
        <th>类型</th>
        <th>抗性</th>
        <th>套装效果名称</th>
        <th>套装</th>
        <th>加成效果</th>
      </table> */}
      <div className="displayBox">
        <div>人物</div>
        <div>类型</div>
        <div>抗性</div>
        <div>套装效果名称</div>
        <div>套装</div>
        <div>加成效果</div>
        {demoData.map(ele=>{})}
      </div>
    </div>
  );
}
